import React from 'react';

const ShareIcon = ({ className, width = 20, height = 20 }) => (
  <svg 
    className={`share-icon ${className || ''}`}
    width={width}
    height={height}
    viewBox="0 0 20 20"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <circle cx="6" cy="10" r="3" stroke="currentColor" strokeWidth="2"/>
    <circle cx="16" cy="6" r="3" stroke="currentColor" strokeWidth="2"/>
    <circle cx="16" cy="14" r="3" stroke="currentColor" strokeWidth="2"/>
    <path d="M8.5 8.5L13.5 7.5M8.5 11.5L13.5 12.5" stroke="currentColor" strokeWidth="2"/>
  </svg>
);

export default ShareIcon;
